function out = calcium_oscillation
out{1} = @init;
out{2} = @fun_eval;
out{3} = @jacobian;
out{4} = @jacobianp;
out{5} = @hessians;
out{6} = @hessiansp;
out{7} = @der3;
out{8} = [];
out{9} = [];

% --------------------------------------------------------------------------
function dydt = fun_eval(t,kmrgd,par_v_0,par_v_1,par_beta,par_k_f,par_k,par_V_M2,par_V_M3,par_K_2,par_K_A,par_K_R,par_n,par_m,par_p)
dydt=[par_v_0+(par_v_1*par_beta)-(par_V_M2*((kmrgd(1)^par_n)/(par_K_2^par_n+kmrgd(1)^par_n)))+(par_V_M3*((kmrgd(2)^par_m)/(par_K_R^par_m+kmrgd(2)^par_m))*((kmrgd(1)^par_p)/(par_K_A^par_p+kmrgd(1)^par_p)))+(par_k_f*kmrgd(2))-(par_k*kmrgd(1));
(par_V_M2*((kmrgd(1)^par_n)/(par_K_2^par_n+kmrgd(1)^par_n)))-(par_V_M3*((kmrgd(2)^par_m)/(par_K_R^par_m+kmrgd(2)^par_m))*((kmrgd(1)^par_p)/(par_K_A^par_p+kmrgd(1)^par_p)))-(par_k_f*kmrgd(2));];

% --------------------------------------------------------------------------
function [tspan,y0,options] = init
handles = feval(calcium_oscillation);
y0=[0,0];
options = odeset('Jacobian',handles(3),'JacobianP',handles(4),'Hessians',handles(5),'HessiansP',handles(6));
tspan = [0 10];

% --------------------------------------------------------------------------
function jac = jacobian(t,kmrgd,par_v_0,par_v_1,par_beta,par_k_f,par_k,par_V_M2,par_V_M3,par_K_2,par_K_A,par_K_R,par_n,par_m,par_p)
jac=[ -kmrgd(1)^par_n*par_n/kmrgd(1)/(par_K_2^par_n+kmrgd(1)^par_n)*par_V_M2+(kmrgd(1)^par_n)^2/(par_K_2^par_n+kmrgd(1)^par_n)^2*par_V_M2*par_n/kmrgd(1)+kmrgd(1)^par_p*par_p/kmrgd(1)/(par_K_A^par_p+kmrgd(1)^par_p)*kmrgd(2)^par_m/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3-(kmrgd(1)^par_p)^2/(par_K_A^par_p+kmrgd(1)^par_p)^2*kmrgd(2)^par_m/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3*par_p/kmrgd(1)-par_k , kmrgd(1)^par_p/(par_K_A^par_p+kmrgd(1)^par_p)*kmrgd(2)^par_m*par_m/kmrgd(2)/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3-kmrgd(1)^par_p/(par_K_A^par_p+kmrgd(1)^par_p)*(kmrgd(2)^par_m)^2/(par_K_R^par_m+kmrgd(2)^par_m)^2*par_V_M3*par_m/kmrgd(2)+par_k_f ; kmrgd(1)^par_n*par_n/kmrgd(1)/(par_K_2^par_n+kmrgd(1)^par_n)*par_V_M2-(kmrgd(1)^par_n)^2/(par_K_2^par_n+kmrgd(1)^par_n)^2*par_V_M2*par_n/kmrgd(1)-kmrgd(1)^par_p*par_p/kmrgd(1)/(par_K_A^par_p+kmrgd(1)^par_p)*kmrgd(2)^par_m/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3+(kmrgd(1)^par_p)^2/(par_K_A^par_p+kmrgd(1)^par_p)^2*kmrgd(2)^par_m/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3*par_p/kmrgd(1) , -kmrgd(1)^par_p/(par_K_A^par_p+kmrgd(1)^par_p)*kmrgd(2)^par_m*par_m/kmrgd(2)/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3+kmrgd(1)^par_p/(par_K_A^par_p+kmrgd(1)^par_p)*(kmrgd(2)^par_m)^2/(par_K_R^par_m+kmrgd(2)^par_m)^2*par_V_M3*par_m/kmrgd(2)-par_k_f ];
% --------------------------------------------------------------------------
function jacp = jacobianp(t,kmrgd,par_v_0,par_v_1,par_beta,par_k_f,par_k,par_V_M2,par_V_M3,par_K_2,par_K_A,par_K_R,par_n,par_m,par_p)
jacp=[ 1 , par_beta , par_v_1 , kmrgd(2) , -kmrgd(1) , -kmrgd(1)^par_n/(par_K_2^par_n+kmrgd(1)^par_n) , kmrgd(1)^par_p/(par_K_A^par_p+kmrgd(1)^par_p)*kmrgd(2)^par_m/(par_K_R^par_m+kmrgd(2)^par_m) , kmrgd(1)^par_n/(par_K_2^par_n+kmrgd(1)^par_n)^2*par_V_M2*par_K_2^par_n*par_n/par_K_2 , -kmrgd(1)^par_p/(par_K_A^par_p+kmrgd(1)^par_p)^2*kmrgd(2)^par_m/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3*par_K_A^par_p*par_p/par_K_A , -kmrgd(1)^par_p/(par_K_A^par_p+kmrgd(1)^par_p)*kmrgd(2)^par_m/(par_K_R^par_m+kmrgd(2)^par_m)^2*par_V_M3*par_K_R^par_m*par_m/par_K_R , -kmrgd(1)^par_n*log(kmrgd(1))/(par_K_2^par_n+kmrgd(1)^par_n)*par_V_M2+kmrgd(1)^par_n/(par_K_2^par_n+kmrgd(1)^par_n)^2*par_V_M2*(par_K_2^par_n*log(par_K_2)+kmrgd(1)^par_n*log(kmrgd(1))) , kmrgd(1)^par_p/(par_K_A^par_p+kmrgd(1)^par_p)*kmrgd(2)^par_m*log(kmrgd(2))/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3-kmrgd(1)^par_p/(par_K_A^par_p+kmrgd(1)^par_p)*kmrgd(2)^par_m/(par_K_R^par_m+kmrgd(2)^par_m)^2*par_V_M3*(par_K_R^par_m*log(par_K_R)+kmrgd(2)^par_m*log(kmrgd(2))) , kmrgd(1)^par_p*log(kmrgd(1))/(par_K_A^par_p+kmrgd(1)^par_p)*kmrgd(2)^par_m/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3-kmrgd(1)^par_p/(par_K_A^par_p+kmrgd(1)^par_p)^2*kmrgd(2)^par_m/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3*(par_K_A^par_p*log(par_K_A)+kmrgd(1)^par_p*log(kmrgd(1))) ; 0 , 0 , 0 , -kmrgd(2) , 0 , kmrgd(1)^par_n/(par_K_2^par_n+kmrgd(1)^par_n) , -kmrgd(1)^par_p/(par_K_A^par_p+kmrgd(1)^par_p)*kmrgd(2)^par_m/(par_K_R^par_m+kmrgd(2)^par_m) , -kmrgd(1)^par_n/(par_K_2^par_n+kmrgd(1)^par_n)^2*par_V_M2*par_K_2^par_n*par_n/par_K_2 , kmrgd(1)^par_p/(par_K_A^par_p+kmrgd(1)^par_p)^2*kmrgd(2)^par_m/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3*par_K_A^par_p*par_p/par_K_A , kmrgd(1)^par_p/(par_K_A^par_p+kmrgd(1)^par_p)*kmrgd(2)^par_m/(par_K_R^par_m+kmrgd(2)^par_m)^2*par_V_M3*par_K_R^par_m*par_m/par_K_R , kmrgd(1)^par_n*log(kmrgd(1))/(par_K_2^par_n+kmrgd(1)^par_n)*par_V_M2-kmrgd(1)^par_n/(par_K_2^par_n+kmrgd(1)^par_n)^2*par_V_M2*(par_K_2^par_n*log(par_K_2)+kmrgd(1)^par_n*log(kmrgd(1))) , -kmrgd(1)^par_p/(par_K_A^par_p+kmrgd(1)^par_p)*kmrgd(2)^par_m*log(kmrgd(2))/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3+kmrgd(1)^par_p/(par_K_A^par_p+kmrgd(1)^par_p)*kmrgd(2)^par_m/(par_K_R^par_m+kmrgd(2)^par_m)^2*par_V_M3*(par_K_R^par_m*log(par_K_R)+kmrgd(2)^par_m*log(kmrgd(2))) , -kmrgd(1)^par_p*log(kmrgd(1))/(par_K_A^par_p+kmrgd(1)^par_p)*kmrgd(2)^par_m/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3+kmrgd(1)^par_p/(par_K_A^par_p+kmrgd(1)^par_p)^2*kmrgd(2)^par_m/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3*(par_K_A^par_p*log(par_K_A)+kmrgd(1)^par_p*log(kmrgd(1))) ];
% --------------------------------------------------------------------------
function hess = hessians(t,kmrgd,par_v_0,par_v_1,par_beta,par_k_f,par_k,par_V_M2,par_V_M3,par_K_2,par_K_A,par_K_R,par_n,par_m,par_p)
hess1=[ -kmrgd(1)^par_n*par_n^2/kmrgd(1)^2/(par_K_2^par_n+kmrgd(1)^par_n)*par_V_M2+kmrgd(1)^par_n*par_n/kmrgd(1)^2/(par_K_2^par_n+kmrgd(1)^par_n)*par_V_M2+3*(kmrgd(1)^par_n)^2*par_n^2/kmrgd(1)^2/(par_K_2^par_n+kmrgd(1)^par_n)^2*par_V_M2-2*(kmrgd(1)^par_n)^3/(par_K_2^par_n+kmrgd(1)^par_n)^3*par_V_M2*par_n^2/kmrgd(1)^2-(kmrgd(1)^par_n)^2/(par_K_2^par_n+kmrgd(1)^par_n)^2*par_V_M2*par_n/kmrgd(1)^2+kmrgd(1)^par_p*par_p^2/kmrgd(1)^2/(par_K_A^par_p+kmrgd(1)^par_p)*kmrgd(2)^par_m/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3-kmrgd(1)^par_p*par_p/kmrgd(1)^2/(par_K_A^par_p+kmrgd(1)^par_p)*kmrgd(2)^par_m/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3-3*(kmrgd(1)^par_p)^2*par_p^2/kmrgd(1)^2/(par_K_A^par_p+kmrgd(1)^par_p)^2*kmrgd(2)^par_m/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3+2*(kmrgd(1)^par_p)^3/(par_K_A^par_p+kmrgd(1)^par_p)^3*kmrgd(2)^par_m/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3*par_p^2/kmrgd(1)^2+(kmrgd(1)^par_p)^2/(par_K_A^par_p+kmrgd(1)^par_p)^2*kmrgd(2)^par_m/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3*par_p/kmrgd(1)^2 , kmrgd(1)^par_p*par_p/kmrgd(1)/(par_K_A^par_p+kmrgd(1)^par_p)*kmrgd(2)^par_m*par_m/kmrgd(2)/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3-(kmrgd(1)^par_p)^2/(par_K_A^par_p+kmrgd(1)^par_p)^2*kmrgd(2)^par_m*par_m/kmrgd(2)/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3*par_p/kmrgd(1)-kmrgd(1)^par_p*par_p/kmrgd(1)/(par_K_A^par_p+kmrgd(1)^par_p)*(kmrgd(2)^par_m)^2/(par_K_R^par_m+kmrgd(2)^par_m)^2*par_V_M3*par_m/kmrgd(2)+(kmrgd(1)^par_p)^2/(par_K_A^par_p+kmrgd(1)^par_p)^2*(kmrgd(2)^par_m)^2/(par_K_R^par_m+kmrgd(2)^par_m)^2*par_V_M3*par_m/kmrgd(2)*par_p/kmrgd(1) ; kmrgd(1)^par_n*par_n^2/kmrgd(1)^2/(par_K_2^par_n+kmrgd(1)^par_n)*par_V_M2-kmrgd(1)^par_n*par_n/kmrgd(1)^2/(par_K_2^par_n+kmrgd(1)^par_n)*par_V_M2-3*(kmrgd(1)^par_n)^2*par_n^2/kmrgd(1)^2/(par_K_2^par_n+kmrgd(1)^par_n)^2*par_V_M2+2*(kmrgd(1)^par_n)^3/(par_K_2^par_n+kmrgd(1)^par_n)^3*par_V_M2*par_n^2/kmrgd(1)^2+(kmrgd(1)^par_n)^2/(par_K_2^par_n+kmrgd(1)^par_n)^2*par_V_M2*par_n/kmrgd(1)^2-kmrgd(1)^par_p*par_p^2/kmrgd(1)^2/(par_K_A^par_p+kmrgd(1)^par_p)*kmrgd(2)^par_m/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3+kmrgd(1)^par_p*par_p/kmrgd(1)^2/(par_K_A^par_p+kmrgd(1)^par_p)*kmrgd(2)^par_m/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3+3*(kmrgd(1)^par_p)^2*par_p^2/kmrgd(1)^2/(par_K_A^par_p+kmrgd(1)^par_p)^2*kmrgd(2)^par_m/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3-2*(kmrgd(1)^par_p)^3/(par_K_A^par_p+kmrgd(1)^par_p)^3*kmrgd(2)^par_m/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3*par_p^2/kmrgd(1)^2-(kmrgd(1)^par_p)^2/(par_K_A^par_p+kmrgd(1)^par_p)^2*kmrgd(2)^par_m/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3*par_p/kmrgd(1)^2 , -kmrgd(1)^par_p*par_p/kmrgd(1)/(par_K_A^par_p+kmrgd(1)^par_p)*kmrgd(2)^par_m*par_m/kmrgd(2)/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3+(kmrgd(1)^par_p)^2/(par_K_A^par_p+kmrgd(1)^par_p)^2*kmrgd(2)^par_m*par_m/kmrgd(2)/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3*par_p/kmrgd(1)+kmrgd(1)^par_p*par_p/kmrgd(1)/(par_K_A^par_p+kmrgd(1)^par_p)*(kmrgd(2)^par_m)^2/(par_K_R^par_m+kmrgd(2)^par_m)^2*par_V_M3*par_m/kmrgd(2)-(kmrgd(1)^par_p)^2/(par_K_A^par_p+kmrgd(1)^par_p)^2*(kmrgd(2)^par_m)^2/(par_K_R^par_m+kmrgd(2)^par_m)^2*par_V_M3*par_m/kmrgd(2)*par_p/kmrgd(1) ];
hess2=[ kmrgd(1)^par_p*par_p/kmrgd(1)/(par_K_A^par_p+kmrgd(1)^par_p)*kmrgd(2)^par_m*par_m/kmrgd(2)/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3-(kmrgd(1)^par_p)^2/(par_K_A^par_p+kmrgd(1)^par_p)^2*kmrgd(2)^par_m*par_m/kmrgd(2)/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3*par_p/kmrgd(1)-kmrgd(1)^par_p*par_p/kmrgd(1)/(par_K_A^par_p+kmrgd(1)^par_p)*(kmrgd(2)^par_m)^2/(par_K_R^par_m+kmrgd(2)^par_m)^2*par_V_M3*par_m/kmrgd(2)+(kmrgd(1)^par_p)^2/(par_K_A^par_p+kmrgd(1)^par_p)^2*(kmrgd(2)^par_m)^2/(par_K_R^par_m+kmrgd(2)^par_m)^2*par_V_M3*par_m/kmrgd(2)*par_p/kmrgd(1) , kmrgd(1)^par_p/(par_K_A^par_p+kmrgd(1)^par_p)*kmrgd(2)^par_m*par_m^2/kmrgd(2)^2/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3-kmrgd(1)^par_p/(par_K_A^par_p+kmrgd(1)^par_p)*kmrgd(2)^par_m*par_m/kmrgd(2)^2/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3-3*kmrgd(1)^par_p/(par_K_A^par_p+kmrgd(1)^par_p)*(kmrgd(2)^par_m)^2*par_m^2/kmrgd(2)^2/(par_K_R^par_m+kmrgd(2)^par_m)^2*par_V_M3+2*kmrgd(1)^par_p/(par_K_A^par_p+kmrgd(1)^par_p)*(kmrgd(2)^par_m)^3/(par_K_R^par_m+kmrgd(2)^par_m)^3*par_V_M3*par_m^2/kmrgd(2)^2+kmrgd(1)^par_p/(par_K_A^par_p+kmrgd(1)^par_p)*(kmrgd(2)^par_m)^2/(par_K_R^par_m+kmrgd(2)^par_m)^2*par_V_M3*par_m/kmrgd(2)^2 ; -kmrgd(1)^par_p*par_p/kmrgd(1)/(par_K_A^par_p+kmrgd(1)^par_p)*kmrgd(2)^par_m*par_m/kmrgd(2)/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3+(kmrgd(1)^par_p)^2/(par_K_A^par_p+kmrgd(1)^par_p)^2*kmrgd(2)^par_m*par_m/kmrgd(2)/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3*par_p/kmrgd(1)+kmrgd(1)^par_p*par_p/kmrgd(1)/(par_K_A^par_p+kmrgd(1)^par_p)*(kmrgd(2)^par_m)^2/(par_K_R^par_m+kmrgd(2)^par_m)^2*par_V_M3*par_m/kmrgd(2)-(kmrgd(1)^par_p)^2/(par_K_A^par_p+kmrgd(1)^par_p)^2*(kmrgd(2)^par_m)^2/(par_K_R^par_m+kmrgd(2)^par_m)^2*par_V_M3*par_m/kmrgd(2)*par_p/kmrgd(1) , -kmrgd(1)^par_p/(par_K_A^par_p+kmrgd(1)^par_p)*kmrgd(2)^par_m*par_m^2/kmrgd(2)^2/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3+kmrgd(1)^par_p/(par_K_A^par_p+kmrgd(1)^par_p)*kmrgd(2)^par_m*par_m/kmrgd(2)^2/(par_K_R^par_m+kmrgd(2)^par_m)*par_V_M3+3*kmrgd(1)^par_p/(par_K_A^par_p+kmrgd(1)^par_p)*(kmrgd(2)^par_m)^2*par_m^2/kmrgd(2)^2/(par_K_R^par_m+kmrgd(2)^par_m)^2*par_V_M3-2*kmrgd(1)^par_p/(par_K_A^par_p+kmrgd(1)^par_p)*(kmrgd(2)^par_m)^3/(par_K_R^par_m+kmrgd(2)^par_m)^3*par_V_M3*par_m^2/kmrgd(2)^2-kmrgd(1)^par_p/(par_K_A^par_p+kmrgd(1)^par_p)*(kmrgd(2)^par_m)^2/(par_K_R^par_m+kmrgd(2)^par_m)^2*par_V_M3*par_m/kmrgd(2)^2 ];
hess(:,:,1) =hess1;
hess(:,:,2) =hess2;
% --------------------------------------------------------------------------
function hessp = hessiansp(t,kmrgd,par_v_0,par_v_1,par_beta,par_k_f,par_k,par_V_M2,par_V_M3,par_K_2,par_K_A,par_K_R,par_n,par_m,par_p)
hessp1=[ 0 , 0 ; 0 , 0 ];
hessp2=[ 0 , 0 ; 0 , 0 ];
hessp3=[ 0 , 0 ; 0 , 0 ];
hessp4=[ 0 , 1 ; 0 , -1 ];
hessp5=[ -1 , 0 ; 0 , 0 ];
